// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

struct User {
        address  payable walletaddress	;
        string name;
        string lastname;
        uint rentedCarId;
        uint balance;
        uint debt;
        uint start;
        uint end;
}

struct Car {
        uint id;
        string name;
        string imgUrl;
        bool avaliableforRent;
        uint rentFee; // for every minute
        uint saleFee;
}

interface UserManager {
    function isUser(address payable walletAddress) external view returns (bool);
    function getCars() external view returns (uint[] memory);
    function getCar(uint id) external view returns (Car memory);
    function addUser(address payable walletAddress, string memory name, string memory lastname) external;
    function getUser(address payable walletAddress) external view returns (User memory);
    function checkOut(address payable walletAddress, uint id) external;
    function checkIn(address payable walletAddress) external;
    function deposit(address payable walletAddress, uint amount) payable external;
    function makePayment(address payable walletAddress) external;
    function userDept(address payable walletAddress) external view returns (uint);
    function getUserBalance(address payable walletAddress) external view returns (uint);
}

interface CarManager {
	function addCar(uint id, string memory name, string memory url, uint rent, uint sale) external;
    function setOwner(address newOwner) external;
    function activateCar(uint id) external;
    function deActivateCar(uint id) external;
    function isCarActive(uint id) external view returns (bool);
}

contract Renter {
    address private owner;
    //address private carManagerAddress = 0x0C6E3E42C773AdE1bAAa893f35cC9DF5d677B6CC;
    //address private userManagementAddress = 0x59d83B6bA3DBD2D03CD4c2685933A35dc6D7F3d0;
    address private carManagerAddress;
    address private userManagerAddress;

    constructor(address _carManagerAddress, address _userManagerAddress){
        owner = msg.sender;
        carManagerAddress = _carManagerAddress;
        userManagerAddress = _userManagerAddress;
    }

    modifier onlyOwner() {
        require(msg.sender == owner,"Only owner required");
        _;
    }

    // Getter function to retrieve the owner address
    function getOwner() public view returns (address) {
        return owner;
    }

    // Setter function to change the owner address (restricted to the current owner)
    function setOwner(address newOwner) public onlyOwner {
        require(newOwner != address(0), "New owner address cannot be a zero address");
        owner = newOwner;
    }

    // Get the current value of carManagerAddress
    function getCarManagerAddress() public view returns (address) {
        return carManagerAddress;
    }

    // Set a new value for carManagerAddress
    function setCarManagerAddress(address _carManagerAddress) public onlyOwner {
        carManagerAddress = _carManagerAddress;
    }

    // Get the current value of userManagerAddress
    function getUserManagerAddress() public view returns (address) {
        return userManagerAddress;
    }

    // Set a new value for userManagerAddress
    function setUserManagerAddress(address _userManagerAddress) public onlyOwner {
        userManagerAddress = _userManagerAddress;
    }


    function Login(address payable walletAddress) public view returns (User memory) {
        require(UserManager(userManagerAddress).isUser(walletAddress), "The user does not exist!");
        return UserManager(userManagerAddress).getUser(walletAddress);

    }

    function Register(address payable walletAddress, string memory name, string memory lastname) public returns (User memory) {
        UserManager(userManagerAddress).addUser(walletAddress, name, lastname);
        return UserManager(userManagerAddress).getUser(walletAddress);
    }

    function checkOut(address payable walletAddress, uint id) public {
        UserManager(userManagerAddress).checkOut(walletAddress, id);
    }

    function checkIn(address payable walletAddress) public {
        UserManager(userManagerAddress).checkIn(walletAddress);
    }

    function deposit(address payable walletAddress) payable public {
        UserManager(userManagerAddress).deposit(walletAddress, msg.value);
    }

    function getUserBalance(address payable _userAddress) external view returns(uint) {
        return UserManager(userManagerAddress).getUserBalance(_userAddress);
    }

    function makePayment(address payable walletAddress) public {
        UserManager(userManagerAddress).makePayment(walletAddress);
    }

    function getAllCars() external view returns (uint[] memory) {
        return UserManager(userManagerAddress).getCars();
    }

    function getCar(uint id) public view returns (Car memory) {
        return UserManager(userManagerAddress).getCar(id);
    }

    function getUserDept(address payable _userWallet) public view returns (uint) {
        return UserManager(userManagerAddress).userDept(_userWallet);
    }

    function addCar(uint id, string memory name, string memory url, uint rent, uint sale) public onlyOwner {
    	CarManager(carManagerAddress).addCar(id, name, url, rent, sale); 
    }

    function setCarManagerOwner(address _owner) public onlyOwner {
        CarManager(carManagerAddress).setOwner(_owner);
    }

    function activateCar(uint _id) public onlyOwner {
        CarManager(carManagerAddress).activateCar(_id);
    }

    function deActivateCar(uint _id) public onlyOwner {
        CarManager(carManagerAddress).deActivateCar(_id);
    }

    function isCarActive(uint _id) public view returns (bool) {
        return CarManager(carManagerAddress).isCarActive(_id);
    }
}
